import { memo } from 'react';
import s from './PlannedNewsSection.module.css';

const PlannedNewsSection = () => {
	return (
		<div className={`${s.planned_news} section-container`}>
			<h3>Заплановані</h3>
		</div>
	);
};

export default memo(PlannedNewsSection);
